import React from 'react'
import Link from 'react-router-dom'

const Sidebar = (props) => {
    return(
        <div className="sidebar_div">
            {props.input.blank === false && 
            <React.Fragment>
                <div style={props.input.marginTop}></div>
                <h1 style={test}>{props.input.block1.title}</h1>
                <ul>
                    <li><Link to="/listView">List View</Link></li>
                    <li><Link to="/multiView">Multi View</Link></li>
                </ul>
                <p>{props.input.block1.subtitle}</p>
            </React.Fragment>
            }
        </div>
    );
}

const test = {
    color: "white",
    textAlign: "center"
}

export default Sidebar
